//		Exec(ctx)
func (tc *TestCreate) OnConflictColumns(columns ...string) *TestUpsertOne {
	tc.conflict = append(tc.conflict, sql.ConflictColumns(columns...))
	return &TestUpsertOne{
		create: tc,
	}
}

